const myImage = new Image();
myImage.src = 'data:image/jpeg;base64,'


myImage.addEventListener('load', () => {
  const canvas = document.getElementById('canvas');
  const ctx = canvas.getContext('2d');
  canvas.width = 600;
  canvas.height = 344;
  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height)
  const pixels = ctx.getImageData(0,0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  
  let mappedImages = [];
  for (let j = 0; j < canvas.height; j++) {
    let row = [];
    for (let i = 0; i < canvas.width; i++) {
      const red = pixels.data[j*4*pixels.width + 4*i];
      const green = pixels.data[j*4*pixels.width + 4*i + 1];
      const blue = pixels.data[j*4*pixels.width + 4*i + 2];
      const brightness = calculateRelativeBrightness(red, green, blue);
      let color = `rgb(${red},${green},${blue})`
      const cell = {
        brightness: brightness,
        color: color
      };
      row.push(cell)
    }
    mappedImages.push(row);
  }
  console.log(mappedImages);
  debugger;

  function calculateRelativeBrightness (red, green, blue) {
    return Math.sqrt((red*red)*0.299 + (green*green)*0.587 + (blue*blue)*0.114)/100;
  }

  let particlesArray = [];
  const numOfParticles = 1000;

  function randomInteger (first, second) {
    return Math.floor(Math.random()*(second-first)) + first;
  }

  class Particle{
    constructor () {
      this.x = randomInteger(0, canvas.width);
      this.y = 0;
      this.speed = 0;
      this.velocity = 0.5 + Math.random()*0.5;
      this.size = randomInteger(1, 2);
    }

    update(){
      // console.log(mappedImage[0][0]);
      console.log(mappedImages[Math.floor(this.y)][Math.floor(this.x)].brightness);
      this.speed = mappedImages[Math.floor(this.y)][Math.floor(this.x)].brightness*2;
      let movement = 4 - this.speed + this.velocity;
      movement+=1;
      // debugger;

      this.y += movement;
      // this.y+=this.velocity;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = randomInteger(0, canvas.width);
      }
    }
    draw(){
      ctx.beginPath();
      ctx.fillStyle = mappedImages[Math.floor(this.y)][Math.floor(this.x)]['color'];
      // ctx.fillStyle = 'white';
      // console.log(this.y);
      ctx.arc(this.x, this.y, this.size, 0, Math.PI*2);
      ctx.fill();
    }
  }

  function init(){
    for(let i = 0; i < numOfParticles; i++){
      particlesArray.push(new Particle());
    }
  }

  init();
  function animate() {
    // ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height)
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = 'rgb(0,0,0)'
    ctx.fillRect(0,0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.2;
    for(let i = 0; i < particlesArray.length; i++){
      particlesArray[i].update();
      ctx.globalAlpha = particlesArray[i].speed * 0.1;
      particlesArray[i].draw();
    }
    requestAnimationFrame(animate);
  }
  animate();

})
